sys_script_include.script:
var ControllerFactory = Class.create();
ControllerFactory.prototype = {
    initialize: function() {},

    make: function(request) {
        var controllerName = request.name;
        var controllerRequest = request.request;
        return 'Make Controller: "' + controllerName +
            '" & pass request: "' + JSON.stringify(controllerRequest) +
            '" to it.';
    },

    type: 'ControllerFactory'
};
